import React from 'react';
import styled from 'styled-components';

const Button = ({children}) => {

    return (
        <ButtonStyled className='Button'>
            {children}
        </ButtonStyled>
    );
}

export default Button;

const ButtonStyled = styled.button`
    color: red;
`;
